import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { Project } from '../models/project';
import { Floor } from '../models/floor';
import { Building } from '../models/building';
import { Section } from '../models/section';
import { Realtyobject } from '../models/realtyobject';

@Injectable({
  providedIn: 'root'
})
export class DataService {

  projects: Project[];
  buildings: Building[];
  sections: Section[];
  floors: Floor[];
  realtyobjects: Realtyobject[];

  constructor(private http: HttpClient) {
    this.projectDownload().subscribe(projects => {
      this.projects = projects;
    })

    this.buildingDownload().subscribe(buildings => {
      this.buildings = buildings;
    })

    this.sectionDownload().subscribe(sections => {
      this.sections = sections;
    })

    this.floorDownload().subscribe(floors => {
      this.floors = floors;
    })

    this.realtyobjectDownload().subscribe(realtyobjects => {
      this.realtyobjects = realtyobjects;
    })
  }

  projectDownload(): Observable<Project[]> {
    return this.http.get<Project[]>('http://localhost:64382/api/projects');
  }

  buildingDownload(): Observable<Building[]> {
    return this.http.get<Building[]>('http://localhost:64382/api/buildings');
  }

  sectionDownload(): Observable<Section[]> {
    return this.http.get<Section[]>('http://localhost:64382/api/sections');
  }

  floorDownload(): Observable<Floor[]> {
    return this.http.get<Floor[]>('http://localhost:64382/api/floors');
  }

  realtyobjectDownload(): Observable<Realtyobject[]> {
    return this.http.get<Realtyobject[]>('http://localhost:64382/api/realtyobjects');
  }
}
